import Projects from './components/Projects';

function App() {
  return (
    <div className="bg-primary w-full overflow-hidden">
    <h1 className={`font-kreon font-normal cursor-pointer text-[36px] text-white`}>
    Hello world!
  </h1>

    <Navbar/>
    <Hero/>
    <Projects/>
    <Faq/>
    <Contact/>
   <Footer/>
  </div>
  );
}

export default App;
